import { Fragment, React, useEffect, useRef, useState } from 'react'
import "./Projects.css" 


const instaData = [
  {
    name: "Seshasai",
    Image: "https://w0.peakpx.com/wallpaper/980/16/HD-wallpaper-virat-kohli-king-kohli-virat.jpg",
    like: false,
    imageLike: false,
    count: 0,
  },
  {
    name: "surya",
    Image: "data:image/jpeg;base64,",
    like: false,
    imageLike: false,
    count: 0,
  },
  {
    name: "Anand",
    Image: "data:image/jpeg;base64,",
    like: false,
    imageLike: false,
    count: 0,
  },
  {
    name: "Srinu",
    Image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTukrj_JLycWh-YrCqXmkhMImNCsdvcowlaAwNpTk3F6pNXETsPKUV9Tp35CoI671VvUX8&usqp=CAU",
    like: false,
    imageLike: false,
    count: 0,
  },
  {
    name: "Pavan",
    Image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSTisVaVtw_2o6ixtYtRZ4Kmxgp-6Rviir2aw&usqp=CAU",
    like: false,
    imageLike: false,
    count: 0,
  },
  {
    name: "Jithu",
    Image: "data:image/jpeg;base64,",
    like: false,
    imageLike: false,
    count: 0,
  },
  {
    name: "Sailesh",
    Image: "data:image/jpeg;base64,",
    like: false,
    imageLike: false,
    count: 0,
  },
  {
    name: "Hemanth",
    Image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQS2DKvqhyVtI8MMAC8j2oP-2-JRryjBkNGhA&usqp=CAU",
    like: false,
    imageLike: false,
    count: 0,
  },
]

const Project = () => {

  const [instaState, setInstaState] = useState(instaData)
  const [currPost, setCurrPost] = useState(-1)


  const iconUpdate = (pIndex) => {
    setInstaState((prevInsta) => {
      return prevInsta.map((item, index) => {
        if (pIndex === index) {
          return { ...item, count: item.like ? 0 : 1, like: !item.like }
        } else {
          return item;
        }

      })
    })
  }

  const imageClick = (pIndex) => {
    setInstaState((prevInsta) => {
      return prevInsta.map((item, index) => {
        if (pIndex === index) {
          setCurrPost(pIndex)
          return { ...item, count: item.count + 1, like: true, imageLike: true }
        } else {
          return item;
        }
     
      })   
    })
  }
  useEffect(()=>{
    if(currPost!==-1){
      setTimeout(() => {
        setCurrPost(-1)
      }, 1000);
    }
    
  },[currPost])

  return (
    <div className='main-container' style={{ display: "flex", flexDirection: "column" }}>
      {instaState.map((item, index) => {
        return (
          <Fragment key={index}>
            <div style={{ border: "2px solid black", borderRadius: "5px", width: "300px", height: "75%", marginTop: "10px" }} className='main'>
              <div style={{ textAlign: "center" }}>
                <h4>Instagram Post</h4>
                <p>likeCount =
                  {item.count}
                </p>
              </div>
              <div style={{ borderTop: "2px solid black", textAlign: "start", margin: "2px" }}>
                <i className="fa-regular fa-user"></i>
                {item.name}
              </div>

              <div style={{ textAlign: "center", position: "relative" }}>
                <img src={item.Image} style={{ width: "297px", height: "215px" }} onDoubleClick={() => imageClick(index)} alt='' />
                <div className='showLike' style={{ position: "absolute", top: "42%", left: "42%" }}>
                  {item.imageLike && currPost === index  && <i className='fa-solid fa-heart' style={{ transform: "traslate(-50% -50%)", color: "red", fontSize: "40px" }}></i>}</div>
              </div>

              <div style={{ display: "flex", justifyContent: "space-around", borderTop: "2px solid black" }}>
                <div><i className={item.like ? 'fa-solid fa-heart' : 'fa-regular fa-heart'} onClick={() => iconUpdate(index)} ></i></div>
                <div><i className="fa-regular fa-comment"></i></div>
                <div><i className="fa-solid fa-share"></i></div>
              </div>
            </div>
          </Fragment>
        )

      })}
    </div>
  )
}

export default Project



